        <div className="title">
          <h1>Thank You!</h1>
        </div>
        <div className="body">
          <p>Your details has been successfully submitted. Thanks!</p>
        </div>
        <div className="footer">
          {/* <button
            onClick={() => {
              setOpenModal(false);
            }}
            id="cancelBtn"
          >
            Cancel
          </button> */}
          <button>
            <Link to="/">Continue</Link>
          </button>
        </div>
      </div>
    </div>
  );
}

export default Modal;
